import * as actions from './actionTypes';

export const updateStories = stories => ({
    type: actions.STORIES_UPDATE,
    payload: stories
});

export const openComments = commentId => ({
    type: actions.COMMENTS_OPEN,
    payload: { commentId }
});

export const closeComments = commentId => ({
    type: actions.COMMENTS_CLOSE,
    payload: { commentId }
})
